fil["233"]= "GUID-E106A5C4-E405-4B84-A9CB-E92F6DBFACD2.html@@@Configure Temperature Measurement Alarm in Normal Mode@@@Temperature measurement is mainly applied to the electric and industrial automation fields, which provides accurate and stable temperature measurement for the mid-to-high end manufacturers (e.g., intelligent robot) to realize the process control, automatic detection, and status monitoring of electromechanical devices. You can set the industry thermometry in normal mode to measure the global temperature during the industrial production. When the measured temperature does not meet the configured temperature threshold, the alarm will be triggered and uploaded to monitoring center if configured. And then, you can receive the alarm...";
